import{_ as h,a as e,b as t,c as a,d as c,e as o,f as i,g as r,h as p,i as m,j as d,k as s,l,m as n,n as g,o as u,p as f,q as b,r as w,s as v,t as y,u as _,v as x,w as k,x as T,y as q,z as I,A as P,B as F,C as S}from"./chunks/logged_messages.BLmINYgI.js";import{_ as R,c as D,o as V,ab as A}from"./chunks/framework.CUflZczI.js";const C=JSON.parse('{"title":"Log Analysis using Flight Review","description":"","frontmatter":{},"headers":[],"relativePath":"en/log/flight_review.md","filePath":"en/log/flight_review.md"}'),z={name:"en/log/flight_review.md"},G=A('<h1 id="log-analysis-using-flight-review" tabindex="-1">Log Analysis using Flight Review <a class="header-anchor" href="#log-analysis-using-flight-review" aria-label="Permalink to &quot;Log Analysis using Flight Review&quot;">​</a></h1><p>The <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> plots for a flight can be used to analyze general vehicle condition.</p><p>The plots are meant to be self-explanatory, but it takes some experience to know what ranges are acceptable and what a plot should look like. This page explains how to interpret the plots and identify common problems.</p><h2 id="general-usage" tabindex="-1">General Usage <a class="header-anchor" href="#general-usage" aria-label="Permalink to &quot;General Usage&quot;">​</a></h2><p>Features that are common to many plots:</p><ul><li>Plot background color is used to indicate flight mode during recording (where graphs depend on mode): <img src="'+h+'" alt="Flight Modes"><ul><li><strong>Flight mode:</strong> Background colour on the body of the plot indicates flight mode. Hovering with the mouse over a plot shows the flight mode labels.</li><li><strong>VTOL flight mode:</strong> VTOL vehicles additionally show the VTOL mode as background colour in the bottom part of the plot (blue for multicopter, yellow for fixed-wing, and red for transition).</li></ul></li><li>Mouse scrolling on a particular plot axis zooms that axis (horizontally or vertically).</li><li>Mouse scrolling inside the plot zooms both axes.</li></ul><p><a id="tracking"></a></p><h2 id="pid-tracking-performance" tabindex="-1">PID Tracking Performance <a class="header-anchor" href="#pid-tracking-performance" aria-label="Permalink to &quot;PID Tracking Performance&quot;">​</a></h2><p>Depending on the flight mode, the vehicle controllers may attempt to track position, velocity, altitude or rate setpoints (the tracked setpoints depend on the mode, e.g.: in Stabilized mode there is no velocity setpoint).</p><p>The <strong>Estimated</strong> line (red) should closely match with the <strong>Setpoint</strong> (green). If they do not, in most cases the PID gains of that controller need to be tuned.</p><p>The <a href="./../config_mc/pid_tuning_guide_multicopter.html">Multicopter PID Tuning Guide</a> contains example plots and information about analysing tracking performance.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>For the rate controller in particular, it is useful to enable the high-rate logging profile (<a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a>) to get more details when zooming in.</p></div><h2 id="vibration" tabindex="-1">Vibration <a class="header-anchor" href="#vibration" aria-label="Permalink to &quot;Vibration&quot;">​</a></h2><p>Vibration is one of the most common problems for multirotor vehicles. High vibration levels can lead to:</p><ul><li>less efficient flight and reduced flight time</li><li>the motors can heat up</li><li>increased material wearout</li><li>inability to tune the vehicle tightly, resulting in degraded flight performance.</li><li>sensor clipping</li><li>position estimation failures, potentially resulting in fly-aways.</li></ul><p>It is therefore important to keep an eye on the vibration levels and improve the setup if needed.</p><p>There is a point where vibration levels are clearly too high, and generally lower vibration levels are better. However there is a broad range between &#39;everything is ok&#39; and &#39;the levels are too high&#39;. This range depends on a number of factors, including vehicle size - as larger vehicles have higher inertia, allowing for more software filtering (at the same time the vibrations on larger vehicles are of lower frequency).</p><p>The following paragraphs and sections provide information about what plots to use for checking vibration levels, and how to analyse them.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>It is worth looking at multiple charts when analyzing vibration (different charts can better highlight some issues).</p></div><h3 id="actuator-controls-fft" tabindex="-1">Actuator Controls FFT <a class="header-anchor" href="#actuator-controls-fft" aria-label="Permalink to &quot;Actuator Controls FFT&quot;">​</a></h3><div class="info custom-block"><p class="custom-block-title">INFO</p><p>You need to enable the high-rate logging profile (<a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a>) to see this plot.</p></div><p>This graph shows a frequency plot for the roll, pitch and yaw axis based on the actuator controls signal (the PID output from the rate controller). It helps to identify frequency peaks and configuring the software filters. There should only be a single peak at the lowest end (below around 20 Hz), the rest should be low and flat.</p><p>Note that the y-axis scaling is different for different vehicles, but logs from the same vehicle can be directly compared to each other.</p><h4 id="examples-good-vibration" tabindex="-1">Examples: Good Vibration <a class="header-anchor" href="#examples-good-vibration" aria-label="Permalink to &quot;Examples: Good Vibration&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a> frame (excellent vibration).</p><p><img src="'+e+'" alt="Low vibration QAV-R 5 Racer - FFT plot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The excellent vibration characteristics of the above frame mean that we can considerably increase the cutoff frequency of the <a href="./../config_mc/filter_tuning.html">software filters</a> (reducing control latency).</p></div><p>DJI F450 frame (good vibration).</p><p><img src="'+t+'" alt="Low vibration DJI F450 - FFT plot"></p><p>S500 frame:</p><p><img src="'+a+'" alt="Low vibration S500 actuator controls - FFT plot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>While the plot above looks good, the <a href="#raw_acc_s500">Raw Acceleration graph for the same flight</a> shows that the vibration levels are a bit high for x and y. This is a good example of why it is worth checking several graphs!</p></div><h4 id="examples-bad-vibration" tabindex="-1">Examples: Bad Vibration <a class="header-anchor" href="#examples-bad-vibration" aria-label="Permalink to &quot;Examples: Bad Vibration&quot;">​</a></h4><p>This example shows a peak in frequency close to 50 Hz (in this case due to &quot;loose&quot; landing gear).</p><p><img src="'+c+'" alt="Vibrations in landing gear - FFT plot"></p><h3 id="acceleration-power-spectral-density" tabindex="-1">Acceleration Power Spectral Density <a class="header-anchor" href="#acceleration-power-spectral-density" aria-label="Permalink to &quot;Acceleration Power Spectral Density&quot;">​</a></h3><p>This is a 2D frequency plot showing the frequency response of the raw accelerometer data over time (it displays the sum for the x, y and z axis). The more yellow an area is, the higher the frequency response at that time and frequency.</p><p>Ideally only the lowest part up to a few Hz is yellow, and the rest is mostly green or blue.</p><h4 id="examples-good-vibration-1" tabindex="-1">Examples: Good Vibration <a class="header-anchor" href="#examples-good-vibration-1" aria-label="Permalink to &quot;Examples: Good Vibration&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a> frame (excellent vibration).</p><p><img src="'+o+'" alt="Low vibration QAV-R 5 Racer - spectral density plot"></p><p>DJI F450 frame (good vibration). <img src="'+i+'" alt="Low vibration DJI F450 - spectral density plot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Above you can see the blade passing frequency of the propellers at around 100 Hz.</p></div><p>S500 frame: <img src="'+r+'" alt="Vibration S500 - spectral density plot"></p><h4 id="examples-bad-vibration-1" tabindex="-1">Examples: Bad Vibration <a class="header-anchor" href="#examples-bad-vibration-1" aria-label="Permalink to &quot;Examples: Bad Vibration&quot;">​</a></h4><p>The strong yellow lines at around 100Hz indicate a potential issue that requires further investigation (starting with a review of the other charts).</p><p><img src="'+p+'" alt="High vibration in spectral density plot"></p><p>This plot below shows a peak in frequency close to 50 Hz (in this case due to &quot;loose&quot; landing gear).</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This indicates a possible problem because it is a strong single low frequency that is close to the vehicle dynamics. With the default filter settings of 80 Hz vibrations at 50 Hz will not be filtered.</p></div><p><img src="'+m+'" alt="Vibrations in landing gear - spectral density plot"></p><p>Extremely high (unsafe) vibration! Note that the graph is almost completely yellow.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>You should not fly with such high vibration levels.</p></div><p><img src="'+d+'" alt="Exceedingly high vibration in spectral density plot"></p><h3 id="raw-acceleration" tabindex="-1">Raw Acceleration <a class="header-anchor" href="#raw-acceleration" aria-label="Permalink to &quot;Raw Acceleration&quot;">​</a></h3><p>This graph shows the raw accelerometer measurements for the x, y and z axis. Ideally each line is thin and clearly shows the vehicle&#39;s accelerations.</p><p>As a rule of thumb if the z-axis graph is touching the x/y-axis graph during hover or slow flight, the vibration levels are too high.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The best way to use this graph is to zoom in a bit to a part where the vehicle is hovering.</p></div><h4 id="examples-good-vibration-2" tabindex="-1">Examples: Good Vibration <a class="header-anchor" href="#examples-good-vibration-2" aria-label="Permalink to &quot;Examples: Good Vibration&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a> frame (excellent vibration).</p><p><img src="'+s+'" alt="Low vibration QAV-R 5 Racer - raw accel. plot"></p><p>DJI F450 frame (good vibration). <img src="'+l+'" alt="Low vibration DJI F450 - raw accel. plot"></p><h4 id="examples-bad-vibration-2" tabindex="-1">Examples: Bad Vibration <a class="header-anchor" href="#examples-bad-vibration-2" aria-label="Permalink to &quot;Examples: Bad Vibration&quot;">​</a></h4><p><a id="raw_acc_s500"></a> S500 frame. Borderline vibration levels - a bit high for x and y (which is typical for an S500 airframe). This is at the limit where it starts to negatively affect flight performance.</p><p><img src="'+n+'" alt="Borderline vibration S500 x, y - raw accel. plot"></p><p>Vibration too high. Note how the graph of the z-axis overlaps with the x/y-axis graph:</p><p><img src="'+g+'" alt="Vibrations in landing gear - raw accel. plot"></p><p>Vibration levels are too high. Note how the graph of the z-axis overlaps with the x/y-axis graph:</p><p><img src="'+u+'" alt="High vibration in raw accel. plot"></p><p>Very high (unsafe) vibration levels.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>You should not fly with such high vibration levels.</p></div><p><img src="'+f+'" alt="Exceedingly high vibration in raw accel. plot"></p><p><a id="fifo_logging"></a></p><h3 id="raw-high-rate-imu-data-plots" tabindex="-1">Raw High-rate IMU Data Plots <a class="header-anchor" href="#raw-high-rate-imu-data-plots" aria-label="Permalink to &quot;Raw High-rate IMU Data Plots&quot;">​</a></h3><p>For an in-depth analysis there is an option to log the raw IMU data at full rate (several kHz, depending on the IMU). This allows inspection of much higher frequencies than with normal logging, which can help when selecting vibration mounts or configuring low-pass and notch filters appropriately.</p><p>To use it, some parameters need to be changed:</p><ul><li><p>Set <a href="./../advanced_config/parameter_reference.html#IMU_GYRO_RATEMAX">IMU_GYRO_RATEMAX</a> to 400. This ensures that the raw sensor data is more efficiently packed when sent from the sensor to the rest of the system, and reduces the log size (without reducing useful data).</p></li><li><p>Use a good SD card, as the IMU data requires a high logging bandwidth (Flight Review will show dropouts if the logging rate gets too high).</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>See <a href="./../dev_log/logging.html#sd-cards">Logging &gt; SD Cards</a> for a comparison of popular SD card.</p></div></li><li><p>Enable either the gyro or accel high-rate FIFO profile in <a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a> and disable the rest of the entries. If you are using a really good SD card (seeing few/no dropouts), you can:</p><ul><li>either enable both accel and gyro profiles</li><li>or enable accel/gyro plus the default logging profile</li></ul></li></ul><p>Example plot:</p><p><img src="'+b+'" alt="high-rate accel power spectral density"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Data of the first IMU is logged, which is not necessarily the same as the one used for flying. This is mostly only important in cases where IMU&#39;s are mounted differently (e.g. hard-mounted vs. soft-mounted).</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Do not forget to restore the parameters after testing.</p></div><p><a id="solutions"></a></p><h3 id="fixing-vibration-problems" tabindex="-1">Fixing Vibration Problems <a class="header-anchor" href="#fixing-vibration-problems" aria-label="Permalink to &quot;Fixing Vibration Problems&quot;">​</a></h3><p>Often a source of vibration (or combination of multiple sources) cannot be identified from logs alone.</p><p>In this case the vehicle should be inspected. <a href="./../assembly/vibration_isolation.html">Vibration Isolation</a> explains some basic things you can check (and do) to reduce vibration levels.</p><h2 id="actuator-outputs" tabindex="-1">Actuator Outputs <a class="header-anchor" href="#actuator-outputs" aria-label="Permalink to &quot;Actuator Outputs&quot;">​</a></h2><p>The <em>Actuator Outputs</em> graph shows the signals that are sent to the individual actuators (motors/servos). Generally it is in the range between the minimum and maximum configured PWM values (e.g. from 1000 to 2000).</p><p>This is an example for a quadrotor where everything is OK (all of the signals are within the range, approximately overlap each other, and are not too noisy): <img src="'+w+'" alt="Good actuator outputs"></p><p>The plot can help to identify different problems:</p><ul><li><p>If one or more of the signals is at the maximum over a longer time, it means the controller runs into <strong>saturation</strong>. It is not necessarily a problem, for example when flying at full throttle this is expected. But if it happens for example during a mission, it&#39;s an indication that the vehicle is overweight for the amount of thrust that it can provide.</p></li><li><p>For a multicopter the plot can be a good indication if the vehicle is <strong>imbalanced</strong>. It shows in the plot that one or more neighboring motors (two in case of a quadrotor) need to run at higher thrust on average. Note that this can also be the case if some motors provide more thrust than others or the ESCs are not calibrated. An imbalanced vehicle is generally not a big problem as the autopilot will automatically account for it. However it reduces the maximum achievable thrust and puts more strain on some motors, so it is better to balance the vehicle.</p></li><li><p>An imbalance can also come from the yaw axis. The plot will look similar as in the previous case, but opposite motors will run higher or lower respectively. The cause is likely that one or more motors are tilted.</p><p>This is an example from a hexarotor: motors 1, 3 and 6 run at higher thrust: <img src="'+v+'" alt="Hexrotor imbalanced actuator outputs"></p></li><li><p>If the signals look very <strong>noisy</strong> (with high amplitudes), it can have two causes: sensor noise or vibrations passing through the controller (this shows up in other plots as well, see previous section) or too high PID gains. This is an extreme example: <img src="'+y+'" alt="Noisy actuator outputs - extreme case"></p></li></ul><h2 id="gps-uncertainty" tabindex="-1">GPS Uncertainty <a class="header-anchor" href="#gps-uncertainty" aria-label="Permalink to &quot;GPS Uncertainty&quot;">​</a></h2><p>The <em>GPS Uncertainty</em> plot shows information from the GPS device:</p><ul><li>Number of used satellites (should be around 12 or higher)</li><li>Horizontal position accuracy (should be below 1 meter)</li><li>Vertical position accuracy (should be below 2 meters)</li><li>GPS fix: this is 3 for a 3D GPS fix, 4 for GPS + Dead Reckoning, 5 for RTK float and 6 for RTK fixed type</li></ul><h2 id="gps-noise-jamming" tabindex="-1">GPS Noise &amp; Jamming <a class="header-anchor" href="#gps-noise-jamming" aria-label="Permalink to &quot;GPS Noise &amp; Jamming&quot;">​</a></h2><p>The GPS Noise &amp; Jamming plot is useful to check for GPS signal interferences and jamming. The GPS signal is very weak and thus it can easily be disturbed/jammed by components transmitting (via cable) or radiating in a frequency used by the GPS.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>USB 3 is <a href="https://www.usb.org/sites/default/files/327216.pdf" target="_blank" rel="noreferrer">known to be</a> an effective GPS jamming source.</p></div><p>The <strong>jamming indicator</strong> should be around or below 40. Values around 80 or higher are too high and the setup must be inspected. Signal interference is also noticeable as reduced accuracy and lower number of satellites up to the point where no GPS fix is possible.</p><p>This is an example without any interference:</p><p><img src="'+_+'" alt="GPS jamming - good plot"></p><h2 id="thrust-and-magnetic-field" tabindex="-1">Thrust and Magnetic Field <a class="header-anchor" href="#thrust-and-magnetic-field" aria-label="Permalink to &quot;Thrust and Magnetic Field&quot;">​</a></h2><p>The <em>Thrust and Magnetic Field</em> plot shows the thrust and the norm of the magnetic sensor measurement vector.</p><p>The norm should be constant over the whole flight and uncorrelated with the thrust. This is a good example where the norm is very close to constant: <img src="'+x+'" alt="Thrust and mag close to constant"></p><p><em>If it is correlated</em>, it means that the current drawn by the motors (or other consumers) is influencing the magnetic field. This must be avoided as it leads to incorrect yaw estimation. The following plot shows a strong correlation between the thrust and the norm of the magnetometer: <img src="'+k+'" alt="Correlated thrust and mag"></p><p>Solutions to this are:</p><ul><li>Use an external magnetometer (avoid using the internal magnetometer)</li><li>If using an external magnetometer, move it further away from strong currents (i.e. by using a (longer) GPS mast).</li></ul><p>If the norm is uncorrelated but not constant, most likely it is not properly calibrated. However it could also be due to external disturbances (for example when flying close to metal constructs).</p><p>This example shows that the norm is non-constant, but it does not correlate with the thrust: <img src="'+T+'" alt="Uncorrelated thrust and mag"></p><h2 id="estimator-watchdog" tabindex="-1">Estimator Watchdog <a class="header-anchor" href="#estimator-watchdog" aria-label="Permalink to &quot;Estimator Watchdog&quot;">​</a></h2><p>The <em>Estimator Watchdog</em> plot shows the health report of the estimator. It should be constant zero.</p><p>This is what it should look like if there are no problems: <img src="'+q+'" alt="Estimator watchdog - good"></p><p>If one of the flags is non-zero, the estimator detected a problem that needs to be further investigated. Most of the time it is an issue with a sensor, for example magnetometer interferences. It usually helps to look at the plots of the corresponding sensor.</p><p>Here is an example with magnetometer problems: <img src="'+I+'" alt="Estimator watchdog with magnetometer problems"></p><h2 id="sampling-regularity-of-sensor-data" tabindex="-1">Sampling Regularity of Sensor Data <a class="header-anchor" href="#sampling-regularity-of-sensor-data" aria-label="Permalink to &quot;Sampling Regularity of Sensor Data&quot;">​</a></h2><p>The sampling regularity plot provides insights into problems with the logging system and scheduling.</p><p>The amount of <strong>logging dropouts</strong> start to increase if the log buffer is too small, the logging rate is too high or a low-quality SD card is used.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Occasional dropouts can be expected on medium quality cards.</p></div><p>The <strong>delta t</strong> shows the time difference between two logged IMU samples. It should be close to 4 ms because the data publishing rate is 250Hz. If there are spikes that are a multiple of that (and the estimator time slip does not increase), it means the logger skipped some samples. Occasionally this can happen because the logger runs at lower priority. If there are spikes that are not a multiple, it indicates an irregular sensor driver scheduling, which needs to be investigated.</p><p>The <strong>estimator timeslip</strong> shows the difference between the current time and the time of the integrated sensor intervals up to that time. If it changes it means either the estimator missed sensor data or the driver publishes incorrect integration intervals. It should stay at zero, but it can increase slightly for in-flight parameter changes, which is generally not an issue.</p><p>This is a good example: <img src="'+P+'" alt="Sampling regularity good"></p><p>The following example contains too many dropouts, the quality of the used SD card was too low in that case (see <a href="./../dev_log/logging.html#sd-cards">here</a> for good SD cards):</p><p><img src="'+F+'" alt="Many Dropouts"></p><h2 id="logged-messages" tabindex="-1">Logged Messages <a class="header-anchor" href="#logged-messages" aria-label="Permalink to &quot;Logged Messages&quot;">​</a></h2><p>This is a table with system error and warning messages. For example they show when a task becomes low on stack size.</p><p>The messages need to be examined individually, and not all of them indicate a problem. For example the following shows a kill-switch test: <img src="'+S+'" alt="Logged Messages"></p><h2 id="flight-frame-log-review-examples" tabindex="-1">Flight/Frame Log Review Examples <a class="header-anchor" href="#flight-frame-log-review-examples" aria-label="Permalink to &quot;Flight/Frame Log Review Examples&quot;">​</a></h2><p>It is often worth looking at multiple charts for a particular flight when analyzing vehicle condition (different charts can better highlight some issues). This is particularly important when reviewing for possible vibration problems.</p><p>The section below groups a few (previously presented) charts by flight/vehicle.</p><h3 id="qav-r-5-racer" tabindex="-1">QAV-R 5&quot; Racer <a class="header-anchor" href="#qav-r-5-racer" aria-label="Permalink to &quot;QAV-R 5&quot; Racer&quot;">​</a></h3><p>These charts are all from the same flight of a <a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a>.</p><p>They show a vehicle that has very low vibration:</p><ul><li>Actuator Controls FFT shows only a single peak at the lowest end, with the rest low and flat.</li><li>Spectral density is mostly green, with only a little yellow at the low frequencies.</li><li>Raw Acceleration has z-axis trace well separated from the x/y-axis traces.</li></ul><p><img src="'+e+'" alt="Low vibration QAV-R 5 Racer - FFT plot"></p><p><img src="'+o+'" alt="Low vibration QAV-R 5 Racer - spectral density plot"></p><p><img src="'+s+'" alt="Low vibration QAV-R 5 Racer - raw accel. plot"></p><h3 id="dji-f450" tabindex="-1">DJI F450 <a class="header-anchor" href="#dji-f450" aria-label="Permalink to &quot;DJI F450&quot;">​</a></h3><p>These charts are all from the same flight of a <em>DJI F450</em>.</p><p>They show a vehicle that has low vibration (but not as low as the QAV-R above!):</p><ul><li>Actuator Controls FFT shows a peak at the lowest end. Most of the rest is flat, except for a bump at around 100Hz (this is the blade passing frequency of the propellers).</li><li>Spectral density is mostly green. The blade passing frequency is again visible.</li><li>Raw Acceleration has z-axis trace well separated from the x/y-axis traces.</li></ul><p><img src="'+t+'" alt="Low vibration DJI F450 - FFT plot"></p><p><img src="'+i+'" alt="Low vibration DJI F450 - spectral density plot"></p><p><img src="'+l+'" alt="Low vibration DJI F450 - raw accel. plot"></p><h3 id="s500" tabindex="-1">S500 <a class="header-anchor" href="#s500" aria-label="Permalink to &quot;S500&quot;">​</a></h3><p>These charts are all from the same flight of an S500.</p><p>They show a vehicle that has borderline-acceptable vibration:</p><ul><li>Actuator Controls FFT shows a peak at the lowest end. Most of the rest is flat, except for a bump at around 100Hz.</li><li>Spectral density is mostly green, but more yellow than for the DJI F450 at 100Hz.</li><li>Raw Acceleration has z-axis trace fairly close to the x/y-axis traces. This is at the limit where it starts to negatively affect flight performance.</li></ul><p><img src="'+a+'" alt="Low vibration S500 actuator controls - FFT plot"></p><p><img src="'+r+'" alt="Vibration S500 - spectral density plot"></p><p><img src="'+n+'" alt="Borderline vibration S500 x, y - raw accel. plot"></p>',147),L=[G];function E(O,M,H,N,U,J){return V(),D("div",null,L)}const j=R(z,[["render",E]]);export{C as __pageData,j as default};
